    private function updateItems(array $itemData)
    {
        foreach( $itemData as $item ) {
            $id = $item['id'];
            unset($item['id'], $item['created_at'], $item['updated_at']);

            \DB::table('items')->where('id', $id)
                ->update($item);
        }
    }
